window.bookSummaryJSON = "<p>A short tale of mummies, werewolves, and well-preserved felines set in this Parasol Protectorate prequel!</p> <p>When Alessandro Tarabotti and his valet, Floote, find themselves in Egypt on the queen's business, a chance encounter with tourists quickly leads to a...situation...with the local mummies. Can Allesandro complete his secret mission before he's hijacked by social obligation? And how will his aunt Archangelica react to his treatment of her cat?</p> <p>For years the subject of speculation and rumor, the nature of Alexia Tarabotti's father's adventures and romances is finally revealed in this glorious full-cast audio production with an original score by composer Danny Schade. ArtisticWhispers Productions and <i>New York Times</i> best-selling author Gail Carriger are proud to present you the long-awaited stand-alone prequel to her defining steampunk masterpiece <i>The Parasol Protectorate</i>.</p>"; 
